    /**
     * * Write a function to sort a list of elements using pancake sort.
     *
     * > pancakeSort([15, 79, 25, 38, 69])
     * [15, 25, 38, 69, 79]
     * > pancakeSort([98, 12, 54, 36, 85])
     * [12, 36, 54, 85, 98]
