            if (c1 != c2) {
                i1++;
                i2++;
            } else if (i1 >= len1) {
                i1 = 0;
                return false;
            } else if (i2 >= len2) {
                i2 = 0;
                return false;
            } else if (c1 == c2) {
                i1++;
            } else {
                i2++;
            }
        }
        return i1 == i2;
    }
}

